    url: "/samsung-109-22-cm-43-inch-4k-ultra-hd-smart-led-tv-cue-43cue60a2/p/493911586",
    description:
      '<b>Crystal Processor 4K</b>\n<p>See every shade of color as intended in 4K. Powerful 4K upscaling ensures you watch your favorite content in up to 4K resolution.</p>\n<p align="center">\n<img src="https://www.reliancedigital.in/akamai/images/products/Samsung-Smart-LED-TV-20.jpg" width="100%" height="100%" style="max-height:2000px;max-width:2000px;"><br>\n* This Samsung 4K Smart TV image is for illustration purpose only. Actual image may vary.</p><br>\n\n<b>PurColor</b>\n<p>Fine-tuned color for vibrant, lifelike picture. PurColor enables the TV to express a huge range of colors for optimal picture performance for an immersive viewing experience.</p>\n<p align="center">\n<img src="https://www.reliancedigital.in/akamai/images/products/Samsung-Smart-LED-TV-21.jpg" width="100%" height="100%" style="max-height:2000px;max-width:2000px;"><br>\n* This Samsung 4K Smart TV image is for illustration purpose only. Actual image may vary.</p><br>\n\n<b>Contrast Enhancer</b>\n<p>Enhanced sense of depth and color. Contrast Enhancer dynamically adjusts the contrast, resulting in an enhanced sense of depth and color.</p>\n<p align="center">\n<img src="https://www.reliancedigital.in/akamai/images/products/Samsung-Smart-LED-TV-22.jpg" width="100%" height="100%" style="max-height:2000px;max-width:2000px;"><br>\n* This Samsung 4K Smart TV image is for illustration purpose only. Actual image may vary.</p><br>\n\n<b>Sound Object Tracking Sound Lite (OTS Lite)</b>\n<p>Virtual sound that tracks the action. A 3D surround sound with our virtual top channel audio will allow you to be fully immersed in the audio experience.</p>\n<p align="center">\n<img src="https://www.reliancedigital.in/akamai/images/products/Samsung-Smart-LED-TV-23.jpg" width="100%" height="100%" style="max-height:2000px;max-width:2000px;"><br>\n* This Samsung 4K Smart TV image is for illustration purpose only. Actual image may vary.</p><br>\n\n<b>Q-Symphony</b>\n<p>TV and soundbar orchestrated in perfect harmony. Q-Symphony uniquely allows TV and soundbar speakers to operate simultaneously without muting TV speakers for a more harmonious sound.\nCheck for Q-Symphony compatibility on soundbar product specifications. * Soundbar sold separately.</p>\n<p align="center">\n<img src="https://www.reliancedigital.in/akamai/images/products/Samsung-Smart-LED-TV-24.jpg" width="100%" height="100%" style="max-height:2000px;max-width:2000px;"><br>\n* This Samsung 4K Smart TV image is for illustration purpose only. Actual image may vary.</p><br>\n\n<b>Adaptive Sound</b>\n<p>Hear vivid yet balanced audio with Adaptive Sound that optimizes sound based on real-time scene analysis by content type.</p>\n<p align="center">\n<img src="https://www.reliancedigital.in/akamai/images/products/Samsung-Smart-LED-TV-25.jpg" width="100%" height="100%" style="max-height:2000px;max-width:2000px;"><br>\n* This Samsung 4K Smart TV image is for illustration purpose only. Actual image may vary.</p><br>\n\n<b>Motion Xcelerator</b>\n<p>Smooth motion for a clear picture. Experience clear picture and performance. Motion Xcelerator automatically estimates and compensates frames for the source of contents.</p>\n<p align="center">\n<img src="https://www.reliancedigital.in/akamai/images/products/Samsung-Smart-LED-TV-26.jpg" width="100%" height="100%" style="max-height:2000px;max-width:2000px;"><br>\n* This Samsung 4K Smart TV image is for illustration purpose only. Actual image may vary.</p><br>\n\n<b>3-Side Bezeless Design</b>\n<p>More screen, less bezel. Crafted with an effortless minimalistic style from every angle, the sleek and elegant design draws you to the purest picture.</p>\n<p align="center">\n<img src="https://www.reliancedigital.in/akamai/images/products/Samsung-Smart-LED-TV-27.jpg" width="100%" height="100%" style="max-height:2000px;max-width:2000px;"><br>\n* This Samsung 4K Smart TV image is for illustration purpose only. Actual image may vary.</p><br>\n\n<b>Workspace</b>\n<p>Work and learn from home. Enjoy full possibility of what you can do. Seamlessly access your PC, Laptop, and mobile wireless DeX on your TV.\n* TV and PC must be connected to a network.</p>\n<p align="center">\n<img src="https://www.reliancedigital.in/akamai/images/products/Samsung-Smart-LED-TV-28.jpg" width="100%" height="100%" style="max-height:2000px;max-width:2000px;"><br>\n* This Samsung 4K Smart TV image is for illustration purpose only. Actual image may vary.</p><br>\n\n<b>Smart Hub</b>\n<p>Discover your favorite content in one place. Optimize content curation and discovery, so you spend less time searching and more time streaming movies, games and shows you love.</p>\n<p align="center">\n<img src="https://www.reliancedigital.in/akamai/images/products/Samsung-Smart-LED-TV-29.jpg" width="100%" height="100%" style="max-height:2000px;max-width:2000px;"><br>\n* This Samsung 4K Smart TV image is for illustration purpose only. Actual image may vary.</p><br>\n<b>SmartThings (IoT Hub)</b>\n<p>Your best home butler. Relax and let SmartThings seamlessly connect to, monitor and control all your smart devices to intuitively control your home via a built-in hub.\n\n* Available technology, functions and features may vary by country, service provider, network environment or product, and are subject to change without notice. * Requires a Wi-Fi, Bluetooth or other wireless network connection and login to Samsung account.</p>\n<p align="center">\n<img src="https://www.reliancedigital.in/akamai/images/products/Samsung-Smart-LED-TV-30.jpg" width="100%" height="100%" style="max-height:2000px;max-width:2000px;"><br>\n* This Samsung 4K Smart TV image is for illustration purpose only. Actual image may vary.</p><br>\n\n<b>Samsung TV Plus</b>\n<p>The best of TV. All for free. Pick from 200+ channels and thousands of movies and shows on demand at zero cost.\n* Certain region only * Channels may vary by country and are subject to change without notifications.</p>\n<p align="center">\n<img src="https://www.reliancedigital.in/akamai/images/products/Samsung-Smart-LED-TV-31.jpg" width="100%" height="100%" style="max-height:2000px;max-width:2000px;"><br>\n* This Samsung 4K Smart TV image is for illustration purpose only. Actual image may vary.\n',
