    description:
      '<p><strong>Turbo Cool</strong></p>\n<p>Pre-set mode to instantly cool the room during extreme summers.</p>\n<p align="center"><img src="https://www.reliancedigital.in/akamai/images/products/Bluestar-IC518RNU-Split-AC-581110409-20.jpg" width="100%" height="100%" style="max-height:400px;max-width:400px;"><br>\n* This Samsung Earbuds image is for illustration purpose only. Actual image may vary.</p><br>\n\n<p><strong>5-In-1 Convertible</p></strong>\n<p>Unique 5-in-1 cooling mode to run your AC at 5 different capacities as per the desired comfort. It comes in combination of 2 buttons in the remote.</p>\n<p align="center"><img src="https://www.reliancedigital.in/akamai/images/products/Bluestar-IC518RNU-Split-AC-581110409-21.jpg" width="100%" height="100%" style="max-height:400px;max-width:400px;"><br>\n* This Samsung Earbuds image is for illustration purpose only. Actual image may vary.</p><br>\n\n<p><strong>Smart Ready</strong></p>\n<p>The AC is ready to be operated* using Blue Star\'s Smart App and through Voice Command using Amazon Alexa or Google Home *To operate through Smart App or Voice Command, a user has to pay an additional charge to convert the AC into Smart AC completely.</p>\n<p align="center"><img src="https://www.reliancedigital.in/akamai/images/products/Bluestar-IC518RNU-Split-AC-581110409-22.jpg" width="100%" height="100%" style="max-height:400px;max-width:400px;"><br>\n* This Samsung Earbuds image is for illustration purpose only. Actual image may vary.</p><br>\n\n<p><strong>Energy Saver</strong></p>\n<p>The Eco mode helps save on your electricity bills, while giving you comfortable cooling experience.</p>\n<p align="center"><img src="https://www.reliancedigital.in/akamai/images/products/Bluestar-IC518RNU-Split-AC-581110409-23.jpg" width="100%" height="100%" style="max-height:400px;max-width:400px;"><br>\n* This Samsung Earbuds image is for illustration purpose only. Actual image may vary.</p><br>\n\n<p><strong>Stabliser-Free Operation</strong></p>\n<p>Wide voltage range design ensures protection against unpredictable surges or fluctuations in voltage thus safeguarding the AC. (160V~285V)</p></strong>\n<p align="center"><img src="https://www.reliancedigital.in/akamai/images/products/Bluestar-IC518RNU-Split-AC-581110409-24.jpg" width="100%" height="100%" style="max-height:400px;max-width:400px;"><br>\n* This Samsung Earbuds image is for illustration purpose only. Actual image may vary.</p><br>\n\n<p><strong>Comfort Sleep</strong></p>\n<p>Intelligently adjusts the AC\'s operation providing the right cooling comfort and ensuring comfortable sleep.</p>\n<p align="center"><img src="https://www.reliancedigital.in/akamai/images/products/Bluestar-IC518RNU-Split-AC-581110409-25.jpg" width="100%" height="100%" style="max-height:400px;max-width:400px;"><br>\n* This Samsung Earbuds image is for illustration purpose only. Actual image may vary.</p><br>\n\n<p><strong>100% Copper</strong></p>\n<p>Blue Star AC\'s condenser coil, evaporator coil, and connecting tubes are made of 100% copper, thereby ensuring reliable cooling performance and enhanced durability.</p>\n<p align="center"><img src="https://www.reliancedigital.in/akamai/images/products/Bluestar-IC518RNU-Split-AC-581110409-26.jpg" width="100%" height="100%" style="max-height:400px;max-width:400px;"><br>\n* This Samsung Earbuds image is for illustration purpose only. Actual image may vary.</p><br>\n\n<p><strong>Anti Corrosive Blue Fins For Protection</strong></p>\n<p>Protects the condenser and evaporator coils from corrosion and leakage due to harsh climate, rainwater, salty air, and humidity. Enhances the efficiency and long life of the AC.</p>\n<p align="center"><img src="https://www.reliancedigital.in/akamai/images/products/Bluestar-IC518RNU-Split-AC-581110409-27.jpg" width="100%" height="100%" style="max-height:400px;max-width:400px;"><br>\n* This Samsung Earbuds image is for illustration purpose only. Actual image may vary.</p><br>\n\n<p><strong>Quiet Performance</strong></p>\n<p>A specially designed acoustic jacket that eliminates noise and vibrations, making AC operation quieter.</p>\n<p align="center"><img src="https://www.reliancedigital.in/akamai/images/products/Bluestar-IC518RNU-Split-AC-581110409-28.jpg" width="100%" height="100%" style="max-height:400px;max-width:400px;"><br>\n* This Samsung Earbuds image is for illustration purpose only. Actual image may vary.</p><br>',
