  div.style.gap = "0px";
  div.style.alignItems = "center";
  div.style.height = "350px";
  div.style.width = "270px";

  let img = document.createElement("img");
  img.src = "https://www.reliancedigital.in/" + srcimg;

  img.style.height = "180px";
  img.style.width = "180px";

  let divChild = document.createElement("div");
  divChild.style.display = "flex";
  divChild.style.flexDirection = "column";
  divChild.style.width = "100%";
  divChild.style.height = "150px";

  let p1 = document.createElement("p");
  p1.innerText = name;
  p1.style.height = "2.6em";
  p1.style.lineHeight = "1.4em";
  p1.style.marginRight = "20px";
  p1.style.overflow = "hidden";
  p1.style.color = "#003380";

  let priceContainer = document.createElement("div");

  let p2 = document.createElement("p");
  p2.style.padding = "0";
  p2.style.margin = "0";
  let p2span1 = document.createElement("span");
  p2span1.innerText = "Offer Price ";
  let p2span2 = document.createElement("span");
  p2span2.innerText = value;
  p2span2.style.fontWeight = "bold";
  p2.append(p2span1, p2span2);

  let p3 = document.createElement("p");
  p3.style.padding = "0";
  p3.style.margin = "0";
  let p3span1 = document.createElement("span");
  p3span1.innerText = "M.R.P ";
  let p3span2 = document.createElement("span");
  p3span2.innerText = "₹ " + mrp + ".00";
  p3span2.style.textDecoration = "line-through";
  p3.append(p3span1, p3span2);

  let p4 = document.createElement("p");
